package com.jty.model;import java.io.Serializable;import java.util.Date;import javax.persistence.Entity;import javax.persistence.Id;@SuppressWarnings("serial")@Entity(name = "constant")public class Constant implements Serializable {    @Id	private Integer id;    private Float oneParam;    private Float twoParam;    private Float onePerson;    private Float twoPerson;    private Float threePerson;	public Integer getId() {		return id;	}	public void setId(Integer id) {		this.id = id;	}	public Float getOneParam() {		return oneParam;	}	public void setOneParam(Float oneParam) {		this.oneParam = oneParam;	}	public Float getTwoParam() {		return twoParam;	}	public void setTwoParam(Float twoParam) {		this.twoParam = twoParam;	}	public Float getOnePerson() {		return onePerson;	}	public void setOnePerson(Float onePerson) {		this.onePerson = onePerson;	}	public Float getTwoPerson() {		return twoPerson;	}	public void setTwoPerson(Float twoPerson) {		this.twoPerson = twoPerson;	}	public Float getThreePerson() {		return threePerson;	}	public void setThreePerson(Float threePerson) {		this.threePerson = threePerson;	}	}